import React, { useState } from "react";
import {FaUserSecret, FaBars} from 'react-icons/fa';
import {MdDeveloperMode, MdCode, MdLaptop, MdDesktopMac, MdDeveloperBoard } from 'react-icons/md';
import {HiX} from 'react-icons/hi';
import {Link} from 'react-router-dom';
import './styles.scss';

const Data = [
    {
        label : 'HOME',
        to : '/'
    },
    {
        label : 'ABOUT ME',
        to : '/about'
    },
    {
        label : 'SKILLS',
        to : '/skills'
    },
    {
        label : 'RESUME',
        to : '/resume'
    },
    {
        label : 'PORTFOLIO',
        to : '/portfolio'
    },
    {
        label : 'CONTACT',
        to : '/contact'
    }
]

const Navbar = () => {
    const [toggleIcon, setToggleIcon] = useState(false)

    const handleToggleIcon = () => {
        setToggleIcon(!toggleIcon)
    }

    return(
        <div>
            <nav className="navbar">

                <div className="navbar_container">
                    <Link to={'/'} className="navbar_container_logo">
                    <FaUserSecret size={62} />
                    <FaCode size={62} />
                    </Link>
                </div>

                <ul className={`navbar_container_menu ${toggleIcon ? 'active' : ' '} `}>
                    {
                        Data.map((item, key)=> (
                            <li key={key} className="navbar_container_menu_item">
                                <Link className="navbar_container_menu_item_links" to={item.to}>
                                    {item.label}
                                </Link>
                            </li>
                        ))
                    }
                </ul>

                <div className="nav-icon" onClick={handleToggleIcon}>
                    {
                        toggleIcon ? <HiX size={30} /> : <FaBars size={30} />
                    }
                </div>

            </nav>
        </div>
    )
}

export default Navbar;
